      i0.ɵɵtext(120, "93");
      i0.ɵɵelementEnd();
      i0.ɵɵtext(121, " sp\u00E9cialit\u00E9s des Sciences et Techniques Industrielles (IND) reconnues par le Minist\u00E8re de l'\u00E9ducation secondaire, on peux citer : ");
      i0.ɵɵelementEnd();
      i0.ɵɵelementStart(122, "ul")(123, "li");
